import React from 'react';
import img_urls from './materials';

class Date extends React.Component {
  constructor(props) {
    super(props);
    this.state = {count: 1};
    this.img_urls = img_urls;
  }

  // handleClickメソッドを定義してください
  handleClick() {
    if (this.state.count < 31) {
      this.setState({count : this.state.count + 1})
    } else {
      this.setState({count : this.state.count = 1})
    }

  }


  render() {

    return (
      <div className='main-wrapper'>


          <p>
            <button onClick={() => {this.handleClick()}}>カレンダーをめくる</button>
          </p>
          <div class="scroll-area">
            ここに画像の説明を書く
            <div class="box box__bg_gray">

              <img src={this.img_urls[this.state.count-1]} />
            </div>

            <div class="box box__bg_black"><p>aaa</p><p>bbb</p></div>
          </div>




      </div>


    );
  }
}

export default Date;
